import React, { useState, useEffect } from 'react';
import { gsap } from 'gsap';

const Portfolio = () => {
  const [animationTime, setAnimationTime] = useState(0);
  const cursor = { cursorImage: 'url(cursor.png)' };
  const $portfolioCurrent = React.useRef(null);
  const $portfolioNext = React.useRef(null);
  const tl = gsap.timeline();

  useEffect(() => {
    const currentTime = Date.now();
    if (currentTime - animationTime > 600) {
      setAnimationTime(currentTime);

      tl.set($portfolioNext.current,{
        clipPath: 'polygon(20% 50%, 80% 50%, 80% 50%, 20% 50%)',
      });
      tl.set($portfolioNext.current,{
