      <div ref={$portfolioNext}></div>
    </div>
  );
};

export default Portfolio;
```

In this example, I've added a `useState` hook to keep track of the animation time and updated it with the current time when the animation is triggered. Then, I've added a condition to check if the current time is greater than the desired interval (600ms) before running the animation. If the condition is true, the animation is run and the animation time is updated to the current time. This way, the animation will only run once every 600ms.

